import './App.css';
import Form from './Form';
import FormDialog from './Example';
import Form2 from './Form2';
import Thirdow from './Thirdrow';
import Fourthrow from './Fourthrow';
import Setting from './Setting'
import Container from '@material-ui/core/Container';
import Dialog from './Dialog'
import Puttingallin from './Puttingallin';
import Grid from '@material-ui/core/Grid';


import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <>     
      <Router>
      <Setting />
      <Switch>        
                    <Route exact path="/Puttingallin" >
                      <Grid>
                      <Grid item xs={1} sm={6} md={11} lg={12} >
                      <Puttingallin />
                      </Grid>
                      </Grid>
                    </Route>



        </Switch>
      </Router>
   </>
  )
}

export default App;
